import React from 'react';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import About from './About';
import Contact
 from './Contact';

function Main() {
  return (
    <>



      <Router>
      <Routes>
        <Route path="/" element={<About />}>


          <Route path="/contact" element={<Contact />} />
          <Route path="*" element={<About/>} />
        </Route>
      </Routes>
    </Router>


    </>
  );
}
export default Main;
